import React from "react";

export default function FormField(props) {
  const { label, isRequired, type, name, placeholder, style } = props;

  return (
    <div className="field">
      <label>
        {label}
        {isRequired && <span>*</span>}
      </label>
      <input
        type={type}
        name={name}
        // defaultValue
        placeholder={placeholder}
        style={{ style }}
      />
    </div>
  );
}
